<?php

namespace Tests\Feature;

use App\Models\Place;
use App\Models\User;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Illuminate\Foundation\Testing\WithFaker;
use Tests\TestCase;

class PlaceControllerTest extends TestCase
{
 use RefreshDatabase;
 use WithFaker;

 private string $image = ' data:image/jpeg;base64,';

    public function test_can_list_places()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        Place::factory(2)->create();

        $response = $this->get('/api/places');

        $response->assertStatus(200);
        $response->assertJsonCount(2,'data');
        $this->assertNotNull($response->json('data')[0]['id']);
        $this->assertNotNull($response->json('meta'));
        $this->assertNotNull($response->json('links'));
    }

    public function test_can_filter_places_by_name()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        Place::factory(2)->create();

        Place::factory()->create(['name' => 'omakei']);

        $response = $this->get('/api/places?filter[name]=omakei');

        $response->assertStatus(200);
        $response->assertJsonCount(1,'data');
        $this->assertNotNull($response->json('data')[0]['id']);
        $this->assertNotNull($response->json('meta'));
        $this->assertNotNull($response->json('links'));
    }

    public function test_can_create_place()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        $response = $this->post('/api/places', [
            'name' => $this->faker->address,
            'city' => $this->faker->city,
            'state' => $this->faker->country,
            'image' => $this->image
        ]);

        $response->assertStatus(201);
        $response->assertJsonCount(7,'attributes');
        $this->assertNotNull($response->json('id'));
        $this->assertNotNull($response->json('type'));
        $this->assertNotNull($response->json('links'));
    }

    public function test_can_edit_place()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        $place = Place::factory()->create();

        $response = $this->put('/api/places/'. $place->id , [
            'name' => 'omakei',
            'city' => $this->faker->city,
            'state' => $this->faker->country,
            'image' => $this->image
        ]);

        $response->assertStatus(200);
        $response->assertJsonCount(7,'attributes');
        $this->assertEquals('omakei',$response->json('attributes')['name']);
        $this->assertNotNull($response->json('id'));
        $this->assertNotNull($response->json('type'));
        $this->assertNotNull($response->json('links'));
    }

    public function test_can_show_place()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        $place = Place::factory()->create();

        $response = $this->get('/api/places/'. $place->id );

        $response->assertStatus(200);
        $response->assertJsonCount(7,'attributes');
        $this->assertNotNull($response->json('id'));
        $this->assertNotNull($response->json('type'));
        $this->assertNotNull($response->json('links'));
    }

    public function test_can_delete_place()
    {
        $user = User::factory()->create(['email' => 'omakei96@gmail.com']);

        $this->actingAs($user);

        $place = Place::factory()->create();

        $response = $this->delete('/api/places/'. $place->id );

        $response->assertStatus(204);
        $response->assertNoContent();
    }
}
